d the wave of protests in the wake of his death? What will you say to the nation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1309, \"fields\": {\"priority\": 4, \"description\": \"Are you considering policies such as a national lockdown or a mask mandate to control COVID-19? Conversely, do you plan to speak out against these ideas?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1307, \"fields\": {\"priority\": 5, \"description\": \"Do you have anything to say about some of the stories that have circulated around your opponent's son, Hunter Biden?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1317, \"fields\": {\"priority\": 5, \"description\": \"There has been an increase in Asian-American hate crimes in 2020, along with the rise of COVID and some of your inflammatory statements (such as Kung-flu!). What do you have to say on this topic?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1308, \"fields\": {\"priority\": 5, \"description\": \"To what extent do you support emergency economic legislation to address the effects of COVID-19 on society?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1319, \"fields\": {\"priority\": 6, \"description\": \"How close are we to having an effective vaccine for COVID-19, and what can you tell the American people about its safety and effectiveness.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1318, \"fields\": {\"priority\": 7, \"description\": \"With the tragic passing of Ruth Bader-Ginsburg, you have the opportunity to nominate a new Supreme Court Justice. Who will you choose?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1316, \"fields\": {\"priority\": 7, \"description\": \"Many Democrats are calling for an expansion to the Supreme Court, to counteract some of your controversial appointments. Will you be adding your voice to this debate?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1315, \"fields\": {\"priority\": 8, \"description\": \"Recent articles have discussed you paying no federal income taxes in some previous years, or having a secret Chinese bank account. What is your response?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1320, \"fields\": {\"priority\": 8, \"description\": \"Are you open to attending the customary three debates with your opponent, Mr. Biden?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1321, \"fields\": {\"priority\": 9, \"description\": \"You have caught COVID-19 and require hospitalization, but it fortunately appears you will recover. How will you act in the wake of this episode?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1322, \"fields\": {\"priority\": 9, \"description\": \"You have repeatedly dodged the question when asked whether you will accept the results of this year's election. Do you have any statements to make?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1314, \"fields\": {\"priority\": 10, \"description\": \"Do you have any statements to make in regards to gun control or the right to bear arms?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1310, \"fields\": {\"priority\": 10, \"description\": \"Your plans for a federal infrasctructure bill stalled over the past couple of years. Do you plan to pursue this again if reelected? How large should any package be?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1313, \"fields\": {\"priority\": 10, \"description\": \"Your immigration policies have antagonized opponents and pleased your core supporters, but your signature wall remains unfinished. What do you plan to do next?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1311, \"fields\": {\"priority\": 10, \"description\": \"What is your rationale for the recent truce in Afghanistan? Do you plan to pull out all American troops before the election?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1323, \"fields\": {\"priority\": -2, \"description\": \"The New York Post has broken a story about a laptop that Hunter Biden purportedly lost. Do you have any comment?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1324, \"fields\": {\"priority\": -1, \"description\": \"Where do you want to concentrate your attention on during the final day of the campaign?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 6109, \"fields\": {\"question\": 1300, \"description\": \"My record over the past four years speaks to itself. Record low unemplyoment. Terrific success with tax cuts and foreign policy. If it wasn't for China releasing COVID, this election wouldn't even be a contest.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6110, \"fields\": {\"question\": 1300, \"description\": \"This election is a battle for the soul of America. The radical Democrats want to destroy free speech, handcuff our police, open our borders, and implement a nationwide program of socialism. You must stop them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6111, \"fields\": {\"question\": 1300, \"description\": \"The crooked media is in the tank for Joe Biden and his son Hunter, and they are doing everything they can to make my term, one of the most successful ever, look like a disaster. Don't fall for it!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6112, \"fields\": {\"question\": 1300, \"description\": \"We've done some unbelievable things for conservatism in America, things people wouldn't have dreamed of four years ago. The largest tax cuts in history. Fighting for religious freedom. Standing up to China. I'm very proud.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6113, \"fields\": {\"question\": 1301, \"description\": \"I am the law and order candidate. The riots, the Democrat riots really, and the efforts to undermine the Supreme Court, the phony Russia investigation, and ignoring our immigration laws. It's all coming from the Democrats.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6114, \"fields\": {\"question\": 1301, \"description\": \"We had unbelivable economic growth and it helped out the middle class, and the working people really. Then the Democrats destroyed it with this COVID scare. It's going to come roaring back with me here, just wait.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6115, \"fields\": {\"question\": 1301, \"description\": \"The Democrats are running on a surrender platform. Surrender to COVID, surrender to illegal immigrants, surrender to China, Iran, and Palestine. These aren't people who love America, folks, believe me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6116, \"fields\": {\"question\": 1301, \"description\": \"Joe Biden is a joke, really. He's 78 years old, sits in his basement all day, probably has dementia, and many other issues. Is he the person who will stand up for you and for America?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6117, \"fields\": {\"question\": 1302, \"description\": \"Kung flu is nothing but a criminal attempt by China, an act of war almost, if you think about it, to plunge the globe into chaos and undermine our election in favor of Joe Biden. Let's not forget which one of us is a stooge to China.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6118, \"fields\": {\"question\": 1302, \"description\": \"This is just a little thing, like the flu almost, that the media and the Democrats are attempting to spin into the second coming of the plague. They would rather destroy the American economy and society than see me get reelected.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6119, \"fields\": {\"question\": 1302, \"description\": \"We can all do basic things like wearing masks to slow the spread. And at the same time, we need to be careful about the impact on small business and the economy. I don't think these Democrat lockdowns are sustainable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6120, \"fields\": {\"question\": 1302, \"description\": \"Democrat or Republican, we all need to take this situation extremely seriously and listen to qualified medical experts like Dr. Anthony Fauci. I like to call him Tony, he's a hell of a guy!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6121, \"fields\": {\"question\": 1303, \"description\": \"Unfortunately Joe Biden is so senile, he's probably meeting with them to get this marching orders. He's really just the Crazy Bernie and Commie Liz candidate when you get right down to it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6122, \"fields\": {\"question\": 1303, \"description\": \"We really can't say it enough, the Democrats want to implement radical socialism in this country. What more proof do you need than incidents like this one?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6123, \"fields\": {\"question\": 1303, \"description\": \"Joe Biden is acting like a moderate right now, but you'd better believe that behind the scenes, he'll be spending a lot of time listening to out-of-touch liberals like Elizabeth Warren.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6124, \"fields\": {\"question\": 1303, \"description\": \"Honestly I think Bernie is more popular than Joe is, to tell the truth. I don't know why he's allowing himself to be placated like this when he won the last two primaries. It's very weak.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6125, \"fields\": {\"question\": 1304, \"description\": \"There's absolutely no evidence that masks do anything to stop coronavirus. Even Dr. Fauci said so -- he changed his mind because he hates me, by the way -- but he was clearly saying masks do not help against coronavirus. Look it up!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6126, \"fields\": {\"question\": 1304, \"description\": \"When it makes sense to wear a mask, I wear a mask. I have a mask in my pocket right now. Sometimes it makes sense, and sometimes there's no reason to wear one.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6127, \"fields\": {\"question\": 1304, \"description\": \"Yeah I mean, if you're in a crowd, mingling, it makes sense. You do see some people, and there's no one within 100 feet of these people and they're in the middle of a field, and they're walking around with masks on, and it's insane.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6128, \"fields\": {\"question\": 1304, \"description\": \"Masks are a big factor, as you can see I'm wearing one right now. Our businesses are getting killed by these Democrat lockdowns. Anything that will help us reopen, if it's masks or anything, it's a good thing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6129, \"fields\": {\"question\": 1305, \"description\": \"Hunter's payments were an attempt to bribe Joe Biden, end of story. All we wanted to do was look into it, and we had this impeachment nonsense. If this doesn't show how crooked the Democrats are, I don't know what does.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6130, \"fields\": {\"question\": 1305, \"description\": \"Maybe it was illegal, maybe it wasn't. Mr. Barr can decide that. All I'm saying is, does it matter? We know that Hunter had no expertise in the oil industry, and they're paying him $1 million a year while his father is Vice President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6131, \"fields\": {\"question\": 1305, \"description\": \"I was just asking questions, you know, and then we had this entire phony impeachment scandal. I never said he did something wrong, I just said we have to look into this, and we really should, and Ukraine is the country that can do it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6132, \"fields\": {\"question\": 1305, \"description\": \"You know, we can spend all day talking about who did what and when. I'm not the kind of guy who gets into that stuff. We have a terrific tax cut, a terrific economy, we're building the wall. We have a lot of incredible things to highlight.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6133, \"fields\": {\"question\": 1306, \"description\": \"This was a pretty typical arrest, really. We don\\u2019t have any idea why George Floyd died. Maybe it was the drugs, who knows? Then you have the media fomenting riots and using them to get China Joe elected this fall.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6134, \"fields\": {\"question\": 1306, \"description\": \"Whatever happened, there's no excuse for the riots, the fires, the hatred of white people, and the hatred of police that we're seeing. We have to respect our police or we won't have a country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6135, \"fields\": {\"question\": 1306, \"description\": \"I really don't have a lot to say about this situation. You never like to see a situation like this, whether it's the police, whether it's the drugs. It's just sad.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6136, \"fields\": {\"question\": 1306, \"description\": \"It's unbelievable really. I saw the video, we all saw the video. And think, this is in a place run entirely by Democrats. We've all seen them cover up these incidents before, maybe they'll step in this time and prosecute the officer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6137, \"fields\": {\"question\": 1307, \"description\": \"It's incredible that Hunter Biden isn't in jail right now, when you get down to it. Some Ukranian oligarch was giving him $1 million to do absolutely nothing, and Sleepy Joe was in on it too. Where is the FBI?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6138, \"fields\": {\"question\": 1307, \"description\": \"Democrats keep saying these allegations are debunked and that there's no evidence. Can you imagine what they'd be saying if one of my kids was doing cocaine, making $1 million a year in Ukraine? This is media hypocrisy at its finest.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6139, \"fields\": {\"question\": 1307, \"description\": \"The liberal media would rather cover this kind of salacious gossip than focus on my record-low unemployment, booming economy, and incredibly successful foreign policy victories. We're too smart to play into their hands.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6140, \"fields\": {\"question\": 1307, \"description\": \"Maybe there wasn't a crime here after all. I can admit when I'm wrong. I just thought these payments looked weird and that someone should look into it, was that a crime?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6141, \"fields\": {\"question\": 1308, \"description\": \"We passed a terrific relief bill way back in April, I was very proactive. And you know, we need to think about spending and defecits as well, before we come out with another huge thing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6142, \"fields\": {\"question\": 1308, \"description\": \"I'm working around the clock right now to put $2,000 into the hands of every American. We need to get the economy open again, and we need to get people spending money.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6143, \"fields\": {\"question\": 1308, \"description\": \"If you look at what's happening right now with Dirty Nancy, it's a disgrace. We have a second package all ready to go, and she's blocking it until the election to make me look bad. They're putting dirty politics over helping Americans.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6144, \"fields\": {\"question\": 1309, \"description\": \"The socialist Democratic Party is pushing for lockdowns at every opportunity. They will stop at nothing to exert their control over patriotic, hard-working American citizens and businesses. Not on my watch!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6145, \"fields\": {\"question\": 1309, \"description\": \"I don't think these mandates and lockdowns are a good idea, really. But if that's what San Francisco and New York want to do, as long as they don't impose on the rest of us.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6146, \"fields\": {\"question\": 1309, \"description\": \"I would encourage everyone out there to wear a mask in public. It's just common sense and it will help our struggling small businesses. There could be some legal issues around a mandate, I'm not the expert, but just wear the mask, people!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6147, \"fields\": {\"question\": 1309, \"description\": \"We have some incredibly gifted scientists, people who have been there long before Obama was around by the way, and we've got to listen to them. We could be talking about hundreds of thousands of lives.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6148, \"fields\": {\"question\": 1310, \"description\": \"The corrupt Democrats and their media enablers have stonewalled our attempts at infrastructure spending at every turn, throwing their own voters under the bus to spite me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6149, \"fields\": {\"question\": 1310, \"description\": \"We're going to tremendously push for an infrastructure bill. And you know, one of my favorite pieces of infrastructure is The Wall. That would create so many jobs for a very low cost, but certain people don't want to protect America.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6150, \"fields\": {\"question\": 1310, \"description\": \"I'm the pro-business President, a lot of people have been saying that. We want a decently sized, targeted infrastructure bill that will keep our economy competitive and reserve an appropriate space for private enterprise.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6151, \"fields\": {\"question\": 1310, \"description\": \"We've built a lot of infrastructure already. One of the things the media never talks about is The Wall, we've built hundreds of miles of beautiful wall on the border. And so I'm not sure we need another big bill right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6152, \"fields\": {\"question\": 1311, \"description\": \"Our strategy in Afghanistan under Barack Obama was a total disaster with the surge. All I'm saying is we need to stop wasting our time and get our troops out, and I'd like to see that happen by the end of my term.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6153, \"fields\": {\"question\": 1311, \"description\": \"We have a timetable. I'm confident that when I'm reelected we'll be getting our troops out. Now if I gave you an exact date, the date depends on a lot of factors. I can't even tell you what all those factors are because some of them are secret.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6154, \"fields\": {\"question\": 1311, \"description\": \"Liberals have been complaining about Afghanistan for years, practically since we went there. Now when I finally do something about it, they can't stand that I'm the one fixing this and they start attacking me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6155, \"fields\": {\"question\": 1311, \"description\": \"A truce is just a truce. That's it. We're looking to see if the Taliban meet their commitments, and if not, we're going to pulverize them. We have some terrific planes, terrific missiles, and I'm pretty sure they can get the job done.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6160, \"fields\": {\"question\": 1313, \"description\": \"We've already built most of the wall during my first term, actually. The failing New York Times barely talks about it. I feel pretty good that The Wall will be there for a long time to come.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6161, \"fields\": {\"question\": 1313, \"description\": \"I'm doing everything in my power to get the wall built. We've made some good progress actually, and another four years will really help us all out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6162, \"fields\": {\"question\": 1313, \"description\": \"You know, some bleeding heart types on the left just won't let it happen. It's okay, we have ICE, we have lasers and night vision goggles. Rome wasn't built in a day, that's what they always told me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6163, \"fields\": {\"question\": 1313, \"description\": \"If the radical left would stop stonewalling me on every issue, maybe we could come together and find a better solution on immigration reform.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6164, \"fields\": {\"question\": 1314, \"description\": \"You've seen what's going on out there. Riots, fires, disrespect for police. We need to do everything we can to allow law-abiding citizens to defend themselves at home and in public.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6165, \"fields\": {\"question\": 1314, \"description\": \"It's pretty simple, really. The left wants to take all of the guns in this country and destroy them, whatever the Constitution says about it. Some of them might not admit that, but it's the truth.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6166, \"fields\": {\"question\": 1314, \"description\": \"I think my position on guns has been pretty clear, really. We've stood firm against any new restrictions on gun ownership.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6167, \"fields\": {\"question\": 1314, \"description\": \"I've supported gun regulations when and where they actually make sense. But the leftist media just wants to make me look like an extremist, regardless of the facts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6168, \"fields\": {\"question\": 1315, \"description\": \"I don't know how they come up with these stories, but I can assure you they are all lies. You'd better believe there will be some libel suits coming!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6169, \"fields\": {\"question\": 1315, \"description\": \"Any normal businessman -- Bill Gates, Michael Bloomberg, whoever -- they try to pay as little in taxes as legally possible. It's funny how they never go after these people as long as they fund and support the left.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6170, \"fields\": {\"question\": 1315, \"description\": \"How is Nancy Pelosi worth $100 million? I'm not saying that I've never made a single mistake in my 50 year business career, but I earned my money fair and square.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6171, \"fields\": {\"question\": 1315, \"description\": \"Do I even need to stoop down to the level of CNN and the New York Times? The most important thing is my agenda for American security, liberty, and prosperity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6172, \"fields\": {\"question\": 1316, \"description\": \"What controversy? Three seats opened up, and I filled those seats. Now Democrats want to destroy the very foundation of judicial independence that our entire democracy rests upon.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6173, \"fields\": {\"question\": 1316, \"description\": \"Who cares what I think about this issue? Go ask Joe Biden about it -- he's the one who will have no qualms about signing off on this insane plan if he's elected President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6174, \"fields\": {\"question\": 1316, \"description\": \"What do you want me to say? That I'd be happy if Sleepy Joe nominated four leftist judges to the Supreme Court in some hare-brained court-packing scheme? I'm sure if he does that, we'll be more than happy to retaliate when the voters put us back in charge.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6175, \"fields\": {\"question\": 1316, \"description\": \"I hate how politicized the Democrats have made the Court, but there are better ways of dealing with it than court-packing. Maybe we can all sit together and come up with some term limits, as long as it's fair for everyone.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6176, \"fields\": {\"question\": 1317, \"description\": \"Is this even a real issue, or just some propoganda being put out there by Xi Jingping and the Communist Chinese Party?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6177, \"fields\": {\"question\": 1317, \"description\": \"It's funny how a lot of these supposed hate crimes are taking place in New York and San Francisco. I'm sure they're very inspired by me!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6178, \"fields\": {\"question\": 1317, \"description\": \"A lot of these attacks, unfortunately, are occuring in Democrat-run cities that want to cut policing even further. Who is the real enemy of the Asian-American community?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6179, \"fields\": {\"question\": 1317, \"description\": \"Asian-American hate is wrong. I'd call on it to stop immediately, and I'm sure any intelligent person understands the difference between holding China accountable, and calling for hate domestically.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6180, \"fields\": {\"question\": 1318, \"description\": \"I like Amy Coney Barrett. She's a staunch conservative, a true Catholic thinker, and widely praised across the conservative spectrum.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6181, \"fields\": {\"question\": 1318, \"description\": \"I'm going to go with Barbara Lagoa. She's done a terrific job on the Florida Supreme Court for a number of years, and they are really raving about her down there.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6182, \"fields\": {\"question\": 1318, \"description\": \"I'm really impressed with Amul Thapar. You know he was one of my first federal appointments, which they don't talk about very much, a really great guy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6183, \"fields\": {\"question\": 1318, \"description\": \"I'll agree to wait until January 21st to make my new nominee, if the Democrats will agree to build the wall, pass my stalled stimulus bill, and pass our infrastructure bill.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6184, \"fields\": {\"question\": 1319, \"description\": \"Right now we're incredibly close, I expect to have a major announcement about the vaccine any day now. Under my leadership we've developed one of the most effective vaccines in human history.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6185, \"fields\": {\"question\": 1319, \"description\": \"It's going to happen when it happens, I'm hoping by the end of the year. And shortly thereafter we can finally put an end to the destructive liberal lockdowns that have done so much to damage our country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6186, \"fields\": {\"question\": 1319, \"description\": \"We're going to release the vaccine when it's safe to do so, as soon as we can. We have the best researchers and the best drug companies in the world, and what they've accomplished in this short period of time is astounding.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6187, \"fields\": {\"question\": 1319, \"description\": \"People on the left continue to spread lies and misinformation about our attempts to develop a vaccine. No less than Kamala Harris just said she wouldn't take it. That's the biggest threat to recovery during my second term.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6188, \"fields\": {\"question\": 1320, \"description\": \"For seven months now, Sleepy Joe Biden has barely left the basement of his house. That ends now, and I'm pretty confident the American people won't like what they see from him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6189, \"fields\": {\"question\": 1320, \"description\": \"For seven months now, Sleepy Joe Biden has barely left the basement of his house. That ends now, and I'm pretty confident the American people won't like what they see from him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6190, \"fields\": {\"question\": 1320, \"description\": \"For seven months now, Sleepy Joe Biden has barely left the basement of his house. That ends now, and I'm pretty confident the American people won't like what they see from him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6191, \"fields\": {\"question\": 1320, \"description\": \"Year after after, Republicans subject themselves to sham debates with slanted questions and one-sided moderators. Why should we force the voters to watch that charade again?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6192, \"fields\": {\"question\": 1321, \"description\": \"Sleepy Joe couldn't get 100 people to show up to his rallies if he tried -- so he's using COVID as an excuse. It almost makes you wonder if anyone's even voting for him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6193, \"fields\": {\"question\": 1321, \"description\": \"I'm feeling great now. I was a little sick, and now I'm not. I'm looking forward to closing this campaign out strong with some huge Keep America Great rallies.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6194, \"fields\": {\"question\": 1321, \"description\": \"They say you might be contagious for a little bit, or maybe not, but it's best if we take 3-4 days off before we get back out there.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6195, \"fields\": {\"question\": 1321, \"description\": \"We should all take this moment to appreciate the importance of social distancing and other precautions. It won't be long until we roll out one of the best vaccines in history and defeat this pandemic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6196, \"fields\": {\"question\": 1322, \"description\": \"We know that there's an unbelievable amount of election fraud going on right now, and Democrats are making it even worse in 2020. Of course they want me to just lay back and take it!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6197, \"fields\": {\"question\": 1322, \"description\": \"We just don't know yet -- I've heard some scary things but we need to see here in a few weeks, it's something we'll be checking very closely.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6198, \"fields\": {\"question\": 1322, \"description\": \"If Democrats would join us in supporting a more robust election system with a complete paper audit trail, voter ID, and other common sense measures, then there wouldn't be these questions floating around.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6199, \"fields\": {\"question\": 1322, \"description\": \"Sleepy Joe Biden and I have an incredible difference of opinion on what is best for this country, but ultimately whatever the voters say about it, that's the last word.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6200, \"fields\": {\"question\": 1323, \"description\": \"We know he's a drug addict and totally corrupt. The FBI needs to be looking into this immediately, and the media needs to be covering the story.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6201, \"fields\": {\"question\": 1323, \"description\": \"They talk about October surprises -- this is one the biggest ones ever. And people are trying to post the story and Facebook won't even let them post it. If that's not an assault on democracy, what is?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6202, \"fields\": {\"question\": 1323, \"description\": \"I don't know what's really going on here, but can you imagine how the media would be covering it if this was Donald Jr.? Can there be any more doubt they are in the tank for Sleepy Joe?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6203, \"fields\": {\"question\": 1323, \"description\": \"Look, when it comes down to it, my policies will Keep America Great, and Joe Biden's will bring socialism and decay back to our great and wonderful country. That's more important than any corruption or scandals that his son is involved in.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6204, \"fields\": {\"question\": 1324, \"description\": \"I want us to focus on Pennsylvania, with maybe a quick stop over the border in Ohio.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6205, \"fields\": {\"question\": 1324, \"description\": \"We're going to campaign hard in Michigan, Wisconsin, and Minnesota on this final day of the campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6206, \"fields\": {\"question\": 1324, \"description\": \"We're going to head out west and do some rallies in Arizona and Nevada. I think we'll win both of those states and really surprise a lot of people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6207, \"fields\": {\"question\": 1324, \"description\": \"We should put our focus into Georgia and North Carolina.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6210, \"fields\": {\"question\": 1326, \"description\": \"I've always believed that you need the best person for the job, and what Nikki showed me during her time in my Administration was really impressive. She can really be an inspiration for women and children of immigrants everywhere.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6211, \"fields\": {\"question\": 1326, \"description\": \"The truth is that Mike and I talked, and he's a great man, one of the best ever, and he decided is was time to focus on other priorities and leave a legacy for his family. And of course Nikki is great and we're thrilled to have her on the team.\"}}]");

campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3004, \"fields\": {\"answer\": 6204, \"candidate\": 301, \"answer_feedback\": \"Based on some early results, it appears that many polls significantly overestimated Biden's support. This may be close after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3005, \"fields\": {\"answer\": 6205, \"candidate\": 301, \"answer_feedback\": \"Based on some early results, it appears that many polls significantly overestimated Biden's support. This may be close after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3006, \"fields\": {\"answer\": 6206, \"candidate\": 301, \"answer_feedback\": \"Based on some early results, it appears that many polls significantly overestimated Biden's support. This may be close after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3007, \"fields\": {\"answer\": 6207, \"candidate\": 301, \"answer_feedback\": \"Based on some early results, it appears that many polls significantly overestimated Biden's support. This may be close after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3058, \"fields\": {\"answer\": 6109, \"candidate\": 301, \"answer_feedback\": \"Until you threw in the China comment, this sounded like a relatively restrained opening statement for you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3059, \"fields\": {\"answer\": 6110, \"candidate\": 301, \"answer_feedback\": \"Your core supporters believe every word of this, but does it have enough appeal to swing voters?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3060, \"fields\": {\"answer\": 6111, \"candidate\": 301, \"answer_feedback\": \"Lord knows you've gone on aggrieved attack mode plenty of times over the past four years. But is it enough to get you over the hump for a second term?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3061, \"fields\": {\"answer\": 6112, \"candidate\": 301, \"answer_feedback\": \"This seems like a confident, assertive, but well-grounded theme to base your campaign on.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3062, \"fields\": {\"answer\": 6113, \"candidate\": 301, \"answer_feedback\": \"It's good to mix things up and hit Democrats where they're vulnerable, especially in areas where your criticism might catch on with independent voters.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3063, \"fields\": {\"answer\": 6115, \"candidate\": 301, \"answer_feedback\": \"You are the incumbent President with four years of accomplishments to run on. You're playing into everyone's worst caricature of you when you focus on petty insults like this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3064, \"fields\": {\"answer\": 6116, \"candidate\": 301, \"answer_feedback\": \"You have your own way of stating it, but Biden would be the oldest President in history. Is it really a bad idea to point that out, loudly and repeatedly?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3065, \"fields\": {\"answer\": 6117, \"candidate\": 301, \"answer_feedback\": \"Your statements on COVID and China are quite inflammatory here. Of course, that may not matter to your supporters this November.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3066, \"fields\": {\"answer\": 6119, \"candidate\": 301, \"answer_feedback\": \"The trick with COVID is to strike a sensible compromise between slowing the spread of the disease, and protecting the health of the economy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3067, \"fields\": {\"answer\": 6120, \"candidate\": 301, \"answer_feedback\": \"There are certainly rumblings of discontent with the scientific establishment, but your best path to reelection probably consists in handling COVID well.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3068, \"fields\": {\"answer\": 6121, \"candidate\": 301, \"answer_feedback\": \"Joe Biden is definitely more popular with independents than the progressive left is. One way to hit at Biden is to suggest that he's not the one really calling the shots in the modern Democratic Party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3069, \"fields\": {\"answer\": 6124, \"candidate\": 301, \"answer_feedback\": \"Trying to drive a wedge between the two wings of the Democratic Party might not be a bad idea. Then again, they hate you far more than they hate each other.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3070, \"fields\": {\"answer\": 6125, \"candidate\": 301, \"answer_feedback\": \"In part due to statements like this, America is rapidly becoming polarized on the question of COVID precautions. Will that help you in November?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3071, \"fields\": {\"answer\": 6126, \"candidate\": 301, \"answer_feedback\": \"Health authorities express concern about your refusal to wear a mask at some large events, but will your supporters care?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3072, \"fields\": {\"answer\": 6128, \"candidate\": 301, \"answer_feedback\": \"You seem to be gambling that your voters will reluctantly follow your lead on this issue. And who knows, if COVID goes away sooner, it can only help you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3073, \"fields\": {\"answer\": 6132, \"candidate\": 301, \"answer_feedback\": \"Commentators have noticed a remarkably restrained public persona over the last few weeks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3074, \"fields\": {\"answer\": 6133, \"candidate\": 301, \"answer_feedback\": \"It has been a raucous and emotional couple of weeks in America, and you are certainly doing your part to keep it that way.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3075, \"fields\": {\"answer\": 6136, \"candidate\": 301, \"answer_feedback\": \"Democrats like to portray themselves as stronger on racial justice issues. Maybe your best strategy is, indeed, to turn the tables on them. When is the last time Republicans ran anything in Minneapolis?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3076, \"fields\": {\"answer\": 6138, \"candidate\": 301, \"answer_feedback\": \"It's hard to make Hunter Biden stay in the mainstream news, but your supporters are certainly keeping up with his story.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3077, \"fields\": {\"answer\": 6142, \"candidate\": 301, \"answer_feedback\": \"It might not be traditional Republican policy, but no one can deny that these are unusual and exceptional times.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3078, \"fields\": {\"answer\": 6143, \"candidate\": 301, \"answer_feedback\": \"You might not win this battle, but maybe you can shame Nancy Pelosi as much as possible while it's taking place.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3079, \"fields\": {\"answer\": 6145, \"candidate\": 301, \"answer_feedback\": \"You seem to be striking a balanced, measured tone on something for a change.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3080, \"fields\": {\"answer\": 6146, \"candidate\": 301, \"answer_feedback\": \"You seem to be striking a balanced, measured tone on something for a change.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3081, \"fields\": {\"answer\": 6147, \"candidate\": 301, \"answer_feedback\": \"You might enjoy folk hero status among your fervent supporters, but not even your endorsement can make a lockdown politically palatable.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3082, \"fields\": {\"answer\": 6151, \"candidate\": 301, \"answer_feedback\": \"Nothing seems to be more of a litmus test for how people feel about you than The Wall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3083, \"fields\": {\"answer\": 6152, \"candidate\": 301, \"answer_feedback\": \"Your plans in Afghanistan seem to trigger bipartisan alarm within the Beltway. But... many average people want the troops gone from Afghanistan.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3085, \"fields\": {\"answer\": 6160, \"candidate\": 301, \"answer_feedback\": \"If you think that the current political dynamic is good for you, then hammering on The Wall in your speeches will do nothing but reinforce it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3086, \"fields\": {\"answer\": 6163, \"candidate\": 301, \"answer_feedback\": \"Talk of immigration reform is not popular in your own party. However, you seem to keep your support almost no matter what you say.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3087, \"fields\": {\"answer\": 6164, \"candidate\": 301, \"answer_feedback\": \"This seems like basic, common sense to most of your supporters.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3088, \"fields\": {\"answer\": 6166, \"candidate\": 301, \"answer_feedback\": \"You're hitting the traditional Republican talking points here.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3089, \"fields\": {\"answer\": 6167, \"candidate\": 301, \"answer_feedback\": \"Your core supporters listen politely as you say these words. But they don't quite seem to cheer the way they normally do.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3090, \"fields\": {\"answer\": 6170, \"candidate\": 301, \"answer_feedback\": \"Pundits question whether you're giving the right number here, but it is true that many other politicians are quite wealthy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3091, \"fields\": {\"answer\": 6172, \"candidate\": 301, \"answer_feedback\": \"The fact of the matter is, there is no way that Republicans will not fill these seats on the Court, and you're simply stating the obvious.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3092, \"fields\": {\"answer\": 6175, \"candidate\": 301, \"answer_feedback\": \"Who knows if anything will come of your openness to negotiate on this issue. In the short term, perhaps not really.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3093, \"fields\": {\"answer\": 6176, \"candidate\": 301, \"answer_feedback\": \"Many people believe that you are escalating and tacitly encouraging this situation, rather than speaking out against it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3094, \"fields\": {\"answer\": 6180, \"candidate\": 301, \"answer_feedback\": \"This is a very popular pick among religious conservatives, many of whom believe that Barrett shares their core beliefs on religious freedom and abortion.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3095, \"fields\": {\"answer\": 6181, \"candidate\": 301, \"answer_feedback\": \"Skeptics believe that you passed over more experienced nominees to select someone from Florida. Which isn't to say that Lagoa isn't highly qualified.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3096, \"fields\": {\"answer\": 6182, \"candidate\": 301, \"answer_feedback\": \"You always hate to have litmus tests for the Court, but Democrats are definitely turning it into a \\u201cwar on women\\u201d issue that you replaced Justice Ginsburg with a man. On the other hand, he is an Indian-American man.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3097, \"fields\": {\"answer\": 6183, \"candidate\": 301, \"answer_feedback\": \"You know that this kind of a compromise will never happen. After a couple of days of hemming and hawing, you go ahead and nominate Justice Barrett.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3098, \"fields\": {\"answer\": 6184, \"candidate\": 301, \"answer_feedback\": \"Skeptics wonder if you're even close to making a real vaccine announcement, but it's certainly in line with your personality to promise big.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3099, \"fields\": {\"answer\": 6187, \"candidate\": 301, \"answer_feedback\": \"Harris hits back at you and clarifies her statement (she wouldn't take the vaccine unless the CDC endorsed it), but no matter.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3100, \"fields\": {\"answer\": 6188, \"candidate\": 301, \"answer_feedback\": \"Pundits are unanimous that you seemed, by far, the less presidential of the two candidates. Many are skeptical, though, that it will have any effect in this environment.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3101, \"fields\": {\"answer\": 6189, \"candidate\": 301, \"answer_feedback\": \"Pundits are unanimous that you seemed, by far, the less presidential of the two candidates. Many are skeptical, though, that it will have any effect in this environment.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3102, \"fields\": {\"answer\": 6190, \"candidate\": 301, \"answer_feedback\": \"Pundits are unanimous that you seemed, by far, the less presidential of the two candidates. Many are skeptical, though, that it will have any effect in this environment.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3103, \"fields\": {\"answer\": 6191, \"candidate\": 301, \"answer_feedback\": \"Maybe these debates have outlived their usefullness anyway. Still, there are some whispers that you may have made a mistake.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3104, \"fields\": {\"answer\": 6192, \"candidate\": 301, \"answer_feedback\": \"You're certainly not the type to second guess yourself. There's no sense in changing that now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3105, \"fields\": {\"answer\": 6196, \"candidate\": 301, \"answer_feedback\": \"Many pundits deride your remarks as dangerous and inflammatory, and also point to the polls showing you way behind in the race.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3106, \"fields\": {\"answer\": 6199, \"candidate\": 301, \"answer_feedback\": \"A lot of people are pleasantly surprised to hear you back away from some of the more dangerous statements you've made. Maybe that will include some independent voters?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3107, \"fields\": {\"answer\": 6200, \"candidate\": 301, \"answer_feedback\": \"Let's see what kind of an effect this story has on the final days of the campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3108, \"fields\": {\"answer\": 6201, \"candidate\": 301, \"answer_feedback\": \"Let's see what kind of an effect this story has on the final days of the campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3109, \"fields\": {\"answer\": 6202, \"candidate\": 301, \"answer_feedback\": \"Let's see what kind of an effect this story has on the final days of the campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3110, \"fields\": {\"answer\": 6203, \"candidate\": 301, \"answer_feedback\": \"Let's see what kind of an effect this story has on the final days of the campaign.\"}}]");
